json_method_params.title:
Тело запроса как в документации Google AdWords в виде JSON строки
Например для TargetingIdeaService.get
 {"selector": {
   "ideaType": "KEYWORD",
   "requestType": "STATS",
   "requestedAttributeTypes": ["SEARCH_VOLUME"],
   "searchParameters": {
     "xsi_type": "RelatedToQuerySearchParameter",
     "queries": keywords_for_grab
   },
   "paging": {"startIndex": 0, "numberResults": 100}
 }}

